import React from 'react'
import "../../assets/css/sidemenu.css";

const AllQuestions = () => {
  return (
    <div className='allQuestions'>
        <div className='d-flex justify-content-between ms-4 me-4'>
            <h3>All Questions</h3>
            <button>Ask Query</button>
        </div>
    </div>
  )
}

export default AllQuestions
